pragma solidity ^0.8.0;

contract MyContract {
    mapping (address => uint256) private _balanceOf;
    string private _name;
    string private _symbol;
    uint256 private _totalSupply;
    mapping (address => mapping (address => uint256)) private _allowance;
    address private _admin_address;
    uint8 private _decimals;

    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor() {
        _admin_address = msg.sender;
    }

    function approve(address spender, uint256 value) public returns (bool) {
        _allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function withdraw() public {
        require(msg.sender == _admin_address);
        require(address(this).balance > 0);
        payable(_admin_address).transfer(address(this).balance);
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function transferFrom(address from, address to, uint256 value) public returns(bool) {
        require(to != address(0));
        require(value <= _balanceOf[from]);
        require(value <= _allowance[from][msg.sender]);

        _balanceOf[from] -= value;
        _balanceOf[to] += value;
        _allowance[from][msg.sender] -= value;
        emit Transfer(from, to, value);
        return true;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function decreaseApproval(address spender, uint256 value) public returns (bool) {
        if (value <= _allowance[msg.sender][spender]) {
            _allowance[msg.sender][spender] -= value;
        } else {
            _allowance[msg.sender][spender] = 0;
        }
        emit Approval(msg.sender, spender, _allowance[msg.sender][spender]);
        return true;
    }

    function setAdmin(address newAdmin) public {
        require(msg.sender == _admin_address);
        require(newAdmin != address(0));
        _admin_address = newAdmin;
    }

    function balanceOf(address owner) public view returns (uint256) {
        return _balanceOf[owner];
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function transfer(address to, uint256 value) public returns (bool) {
        require(to != address(0));
        require(value <= _balanceOf[msg.sender]);

        _balanceOf[msg.sender] -= value;
        _balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function increaseApproval(address spender, uint256 addedValue) public returns (bool) {
        _allowance[msg.sender][spender] += addedValue;
        emit Approval(msg.sender, spender, _allowance[msg.sender][spender]);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowance[owner][spender];
    }

    function admin_address() public view returns (address) {
        return _admin_address;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    fallback() external payable {}
}
```

